angular
    .module('admin')
    .controller('EventsItemController', EventsItemController)

function EventsItemController(api, $log, id, $scope, $state, parseWhenDate, eventsRepeateStates, FileUploader, dataURItoBlob, validateEventForm, $document, $interval, $timeout, $uibModal, securityContext, moment, $filter, utils) {
    var vm = this;
    if (securityContext.data.permissions.events == 'write') {
        vm.showControls = true;
    }

    vm.showSpinner = true;

    vm.loading = false;
    vm.uploader2 = new FileUploader();


    vm.tinymceOptions = {
        plugins: 'textcolor colorpicker ',
        block_formats: 'Paragraph=p;Header 1=h1;Header 2=h2;Header 3=h3; Header 4 = h4; Header 5=h5;Header 6=h6',
        toolbar: 'formatselect | bold italic underline | alignleft aligncenter alignright alignjustify | forecolor',
        height: 300,
        menubar: false,
        statusbar: false,
        readonly: securityContext.data.permissions.events == 'write' ? false : true
    }

    vm.dateOptions = {
        format: 'dd-MMMM-yy',
        minDate: new Date(),
        showWeeks: false
    };

    vm.popup = {
        opened: false
    };

    vm.open = function () {
        vm.popup.opened = true;
    };

    vm.repeateStates = eventsRepeateStates();

    function isEmpty(str) {
        return (!str || 0 === str.length);
    }



    if (id != 0) {
        if (securityContext.data.permissions.events == 'write') {
            vm.showControls = true;
            vm.showEditButtons = true;
        } else {
            vm.showControls = false;
            vm.showEditButtons = false;
        }
        api.getEvent(id).then(function (response) {
            console.log("response is-----", response);
            if (response.status == 200) {
                vm.showSpinner = false;

                vm.item = response.data;

                vm.item.creationDate += 'Z';

                vm.item.description2 = vm.item.description;

                if (!isEmpty(response.data.bannerFileName) || !isEmpty(response.data.previewImageFileName)) {
                    api.getFile(response.data.bannerFileName).then(function (response) {
                        vm.item.banner = response;
                    });
                    api.getFile(response.data.previewImageFileName).then(function (response) {
                        vm.item.previewImage = response;
                    });
                }

                if (vm.item.eventImageFilesNames.length > 0) {
                    vm.item.eventImages = vm.item.eventImageFilesNames.map(function (item, index, array) {
                        var newItem = {
                            imagePath: array[index]
                        }
                        api.getFile(newItem.imagePath).then(function (response) {
                            newItem.imageURL = response
                        });
                        return newItem;
                    })
                }

                if (response.data.timeOfEvent) {
                    var timeFrom = (response.data.timeOfEvent.split(' - ')[0]);
                    var timeTo = (response.data.timeOfEvent.split(' - ')[1]);
                    vm.dateFrom = new Date;
                    vm.dateFrom.setHours(timeFrom.split(':')[0], timeFrom.split(':')[1]);
                    vm.dateTo = new Date;
                    vm.dateTo.setHours(timeTo.split(':')[0], timeTo.split(':')[1]);
                    vm.item.time = $filter('date')(vm.dateFrom, 'HH:mm') + ' - ' + $filter('date')(vm.dateTo, 'HH:mm');
                }

                vm.date = moment(vm.item.creationDate, moment.ISO_8601)._d;
                vm.item.remark = vm.item.remark == null ? "" : vm.item.remark;
                vm.item.status = $filter('status')(vm.item);

                vm.whenDate = parseWhenDate(vm.item.repeatEventState, vm.date);
                angular.element($document.find('#fileInputId')).on('change', vm.handleFileSelect);
            }
        })
    } else {
        vm.showSpinner = false;
        vm.showEditButtons = false;
        vm.item = {};
        vm.dateFrom = new Date();
        vm.dateTo = new Date();
        vm.date = new Date();
        vm.whenDate = parseWhenDate(vm.item.repeatEventState, vm.date);
        vm.item.time = $filter('date')(vm.dateFrom, 'HH:mm') + ' - ' + $filter('date')(vm.dateTo, 'HH:mm');
        angular.element($document.find('#fileInputId')).on('change', vm.handleFileSelect);
    }

    vm.handleFileSelect = function (evt) {
        var file = evt.currentTarget.files[0];
        console.log("file", file);
        var reader = new FileReader();
        reader.onload = function (evt) {
            $scope.$apply(function () {
                vm.myImage = evt.target.result;
            });
            console.log('my image', vm.myImage);
        };
        reader.readAsDataURL(file);
    };


    vm.changeWhenDay = function () {
        vm.whenDate = parseWhenDate(vm.item.repeatEventState, vm.date);

    }

    vm.changed = function () {
        vm.item.time = $filter('date')(vm.dateFrom, 'HH:mm') + ' - ' + $filter('date')(vm.dateTo, 'HH:mm');
    }

    vm.update = function () {

        vm.formValidation = validateEventForm.validForm(vm.item);
        if (vm.formValidation.valid) {
            vm.loading = true;

            vm.item.date = moment(vm.date).format();

            var waiter = $interval(function () {
                var formData = new FormData();

                if (angular.isUndefined(vm.myCroppedImageBlob) && angular.isDefined(vm.item.banner)) {
                    formData.append("ImageState", 0);
                }

                if (angular.isDefined(vm.myCroppedImageBlob)) {
                    formData.append("ImageState", 1);
                    var blob = dataURItoBlob(vm.myImage);
                    formData.append("Banner", blob);
                    formData.append("PreviewImage", vm.myCroppedImageBlob);
                }
                if (angular.isUndefined(vm.item.banner) && angular.isUndefined(vm.myCroppedImageBlob)) {
                    formData.append("ImageState", 2);
                }
                vm.uploader2.queue.forEach(function (item, i) {
                    formData.append("img" + i, item._file);
                })

                if (vm.item.eventImages) {
                    vm.item.eventImages.forEach(function (item, i) {
                        formData.append("ImagesPathes[" + i + "]", item.imagePath);
                    })
                }

                formData.append("CreationDate", vm.item.date);
                formData.append("TimeOfEvent", vm.item.time);

                formData.append("Id", id);
                formData.append('IsInDraft', vm.item.isInDraft);
                formData.append('ShortDescription', angular.isUndefined(vm.item.shortDescription) ? "" : vm.item.shortDescription);
                formData.append('Description', angular.isUndefined(vm.item.description) ? "" : vm.item.description);
                formData.append('RepeatEventState', vm.item.repeatEventState);
                formData.append('Name', angular.isUndefined(vm.item.name) ? "" : vm.item.name);
                formData.append('Location', angular.isUndefined(vm.item.location) ? "" : vm.item.location);
                formData.append('Remark', angular.isUndefined(vm.item.remark) ? "" : vm.item.remark);

                $interval.cancel(waiter);

                api.updateEvent(formData).then(function (response) {
                    if (response.status == 200) {
                        $state.go('index.events');
                        if (vm.item.isInDraft) {
                            $scope.$emit('arrEventChanged:Upd', response.data);
                            utils.notify({
                                message: 'Draft updated successfully',
                                type: 'success'
                            })
                        } else {
                            utils.notify({
                                message: 'Event updated successfully',
                                type: 'success'
                            })
                        }

                    } else {
                        $state.go('index.events');
                        utils.notify({
                            message: 'Something going wrong',
                            type: 'error'
                        })
                    }
                })
            }, 1000);
        }
    }

    vm.save = function () {
        vm.formValidation = validateEventForm.validForm(vm.item);

        if (vm.formValidation.valid) {

            vm.loading = true;

            vm.item.date = moment(vm.date).format();

            var waiter = $interval(function () {
                var formData = new FormData();

                if (angular.isUndefined(vm.myCroppedImageBlob) && angular.isDefined(vm.item.banner)) {

                    /*   if(!vm.item.bannerFileName || vm.item.bannerFileName === ''){
                          vm.item.banner = '../../../assets/kapsarc.jpg'
                      } */

                    formData.append("Banner", vm.item.bannerFileName);
                    formData.append("PreviewImage", vm.item.previewImageFileName);
                    formData.append("ImageState", 0);
                }

                if (angular.isDefined(vm.myCroppedImageBlob)) {
                    formData.append("ImageState", 1);
                    var blob = dataURItoBlob(vm.myImage);
                    formData.append("Banner", blob);
                    formData.append("PreviewImage", vm.myCroppedImageBlob);
                }
                if (angular.isUndefined(vm.item.banner) && angular.isUndefined(vm.myCroppedImageBlob)) {
                    formData.append("ImageState", 2);
                }

                vm.uploader2.queue.forEach(function (item, i) {
                    formData.append("img" + i, item._file);
                })

                if (vm.item.eventImages) {
                    vm.item.eventImages.forEach(function (item, i) {
                        formData.append("ImagesPathes[" + i + "]", item.imagePath);
                    })
                }

                formData.append("TimeOfEvent", vm.item.time);
                formData.append("CreationDate", vm.item.date);
                formData.append('IsInDraft', true);
                formData.append('ShortDescription', angular.isUndefined(vm.item.shortDescription) ? "" : vm.item.shortDescription);
                formData.append('Description', angular.isUndefined(vm.item.description) ? "" : vm.item.description);
                formData.append('RepeatEventState', vm.item.repeatEventState);
                formData.append('Name', angular.isUndefined(vm.item.name) ? "" : vm.item.name);
                formData.append('Location', angular.isUndefined(vm.item.location) ? "" : vm.item.location);
                formData.append('Remark', angular.isUndefined(vm.item.remark) ? "" : vm.item.remark);

                /*  for (var value of formData.values()) {
                     console.log(value); 
                  } */

                $interval.cancel(waiter);

                api.createEvent(formData).then(function (response) {
                    if (response.status == 200) {
                        api.getAllDraftsEvents().then(function (response2) {
                            if (response2.status == 200) {
                                $scope.$emit('arrEventChanged:Add', response2.data);
                                $state.go('index.events');
                                utils.notify({
                                    message: 'Draft created successfully',
                                    type: 'success'
                                })
                            }
                        })
                    } else {
                        $state.go('index.events');
                        utils.notify({
                            message: 'Something going wrong',
                            type: 'error'
                        })
                    }
                })
            }, 1000);
        }
    }

    vm.send = function () {
        vm.formValidation = validateEventForm.validForm(vm.item);
        if (vm.formValidation.valid) {
            var dateToCompare = new Date();
            dateToCompare.setHours(0);

            if (Date.parse(vm.date) < Date.parse(dateToCompare)) {
                utils.notify({
                    message: 'Choose another date of event',
                    type: 'warning'
                });
                return;
            }

            vm.loading = true;

            vm.item.date = moment(vm.date).format();

            var waiter = $interval(function () {
                var formData = new FormData();


                if (angular.isUndefined(vm.myCroppedImageBlob) && angular.isDefined(vm.item.banner)) {
                    formData.append("Banner", vm.item.bannerFileName);
                    formData.append("PreviewImage", vm.item.previewImageFileName);
                    formData.append("ImageState", 0);
                }


                if (angular.isDefined(vm.myCroppedImageBlob)) {
                    formData.append("ImageState", 1);
                    var blob = dataURItoBlob(vm.myImage);
                    formData.append("Banner", blob);
                    formData.append("PreviewImage", vm.myCroppedImageBlob);
                }
                if (angular.isUndefined(vm.item.banner) && angular.isUndefined(vm.myCroppedImageBlob)) {

                    vm.myImage = "data:image/jpeg;base64,";
                    var blob = dataURItoBlob(vm.myImage);
                    formData.append("Banner", blob);
                    formData.append("ImageState", 1);
                    formData.append("PreviewImage", blob)
                }

                vm.uploader2.queue.forEach(function (item, i) {
                    formData.append("img" + i, item._file);
                })

                if (vm.item.eventImages) {
                    vm.item.eventImages.forEach(function (item, i) {
                        formData.append("ImagesPathes[" + i + "]", item.imagePath);
                    })
                }

                console.log("banner 1", vm.item.bannerFileName);
                console.log("banner 2", vm.item.banner);


                formData.append('IsInDraft', false);
                formData.append("TimeOfEvent", vm.item.time);
                formData.append("CreationDate", vm.item.date);
                formData.append('ShortDescription', angular.isUndefined(vm.item.shortDescription) ? "" : vm.item.shortDescription);
                formData.append('Description', angular.isUndefined(vm.item.description) ? "" : vm.item.description);
                formData.append('RepeatEventState', vm.item.repeatEventState);
                formData.append('Name', angular.isUndefined(vm.item.name) ? "" : vm.item.name);
                formData.append('Location', angular.isUndefined(vm.item.location) ? "" : vm.item.location);
                formData.append('Remark', angular.isUndefined(vm.item.remark) ? "" : vm.item.remark);

                /*  for (var value of formData.values()) {
                     console.log(value); 
                  }  */

                $interval.cancel(waiter);

          /*       for (var key of formData.entries()) {
                    console.log("key", key)
                }

                for (var value of formData.values()) {
                    console.log("value", value)
                }
 */

                api.createEvent(formData).then(function (response) {
                    if (response.status == 200) {
                        $state.go('index.events');
                        utils.notify({
                            message: 'Event created successfully',
                            type: 'success'
                        })
                    } else {

                        $state.go('index.events');
                        utils.notify({
                            message: 'Something going wrong',
                            type: 'error'
                        })
                    }
                })
            }, 1000);
        }
    }


    vm.removeImg = function ($index) {
        vm.item.eventImages.splice($index, 1);
    };

    vm.removeBanner = function () {
        delete vm.item.banner;
        delete vm.item.previewImage;
        $timeout(function () {
            angular.element($document.find('#fileInputId')).on('change', vm.handleFileSelect);
        }, 100);
    };

    vm.delete = function () {
        vm.loading = true;
        vm.modalInstance = $uibModal.open({
            templateUrl: 'app/events/eventsModals/modalDeleteEvent.template.html',
            controller: 'modalDeleteEventController as modalDeleteEventCtrl',
            resolve: {
                item: function () {
                    return vm.item;
                }
            }
        });

        vm.modalInstance.result.then(function (result) {
            if (result) {
                api.deleteEvent(id).then(function (response) {
                    if (response.status == 200) {
                        $scope.$emit('arrEventChanged:Del', id);
                        $state.go('index.events');
                        utils.notify({
                            message: 'Deleted successfully',
                            type: 'success'
                        })
                    } else {
                        $state.go('index.events');
                        utils.notify({
                            message: 'Something going wrong',
                            type: 'error'
                        });

                    }
                })
            } else {
                vm.loading = false;
            }
        }, function () {
            vm.loading = false;
        })
    }

    $scope.$watch(function () {
        return vm.item;
    }, function () {
        $timeout(function () {
            angular.element($document.find('#fileInputId')).on('change', vm.handleFileSelect);
        }, 100)
    });
}